(171, 134, '2017-10-13-13-04-59-878.jpg', 'Today Is Akanksha\'s Birthday. Wish Akanksha <b style=\'color:purple;\'> A Very Happy Birthday </b>', 'public', '', '2018-01-20'),
(172, 67, '', 'STORY OF A BOY NAMED AKHIL\\r\\n\\r\\nSUBJECT : This deals with a genuine story of a middle class boy (akhil). How he lives his life in a modern generation, His ideology, His way of thinking, His characterization, His complete life story.\\r\\n\\r\\nIntroduction of Akhil : \\r\\n\\r\\nAkhil, A person with unique thinking with lot of love on his parents, friends &amp; family. He had helping nature with some limitations. A full package of positive thinker. He believes in hardwork instead of depending on others. Finally he never believe anyone except few, who are unique to him. Simply in single word he is Genuine person.\\r\\n\\r\\nShort story till his +2:\\r\\n\\r\\nHis life started in Cambridge high school, basically he is very week in studies but more creative in doing each and every task differently from all. He had his first crush on a girl named shirisha in 2nd class. But unfortunately he left that school and joined in D.P.S. Though he changed his school, his habits &amp; education life is as it is. But from 3rd class he hate girls due to his failure of his first love on his crush. So he hate girls &amp; dont like to talk with girls and more hyperactive in sports. Started forming boys gang. As he studied in D.P.S his friends &amp; environment is good &amp; not directed to any wrong direction but just weak in studies. \\r\\n\\r\\nHe changed his school in 9th standard to fidzzy &amp; started changing himself from sports to education life but didn\\&#039;t started liking &amp; talking with girls. Successfully he had completed 10th standard with good results as he is before. \\r\\n\\r\\nThen he entered into intermediate &amp; copleted his +2 standard successfully with good marks.\\r\\n\\r\\nTill now he is hyperactive in sports, education but don\\&#039;t know what actually a life his. He just lived his life for the sake of his parents. Now his btech and real life starts.\\r\\n\\r\\nBtech life story of akhil in SRM UNIVERSITY :\\r\\n\\r\\n1st day of the college. Akhil is so excited abt his college/btech life. After getting hurt by a girl shirisha in 2nd class later on the 1st day of the college itself he had a attraction on a girl amu. He tried to impress her, tried to become friend, tried to connect to her. But unfortunately his friend itself loving the same girl. So akhil just sacrificed her to his friend love. Later as usual he started hating girls again. He just concentrated on education, building his skills, doing some creative stuff. So finally completed his 1st year.\\r\\n\\r\\nSo the love story of akhil starts in 2nd year. Till now he had seen 2 girls one is shirisha and the other one is amu just he had a attraction on them. But for the first time when he saw a girl named ananya in a fest meet he decided she is her world. Till now he is a person with different thoughts on his career but after seeing ananya he felt nothing is more important than her. Her smile, her expressions, her looks makes  him  happy. Started listening songs, started dreaming, started to know what actually a life his, what actually a relationship his, what actually a true love his. Even got to know the value of waiting for her messages, meaning of excitement, meaning of tension and etc. \\r\\n\\r\\nFinally one day akhil proposed.... But ananya rejected akhil love and started hating him. Though Akhil know ananya wont love him he never giveup his love &amp; tried very seriously, went to depression but never neglected his studies. To be frank akhil started something new things just to impress ananya. But everything became waste, one day the love story of akhil &amp; ananya\\&#039;s got to know to ananya\\&#039;s father and the situation became very serious. Then akhil started forgetting her, he tried a lot but he is unable to forget her.\\r\\n\\r\\n( Akhil had a best friend named as swaroop. This character is very important in akhils life but right now der is no role in this story. )\\r\\n\\r\\n( akhil had a secret crush on a girl called kavya. Remember this name we will discuss it later.)\\r\\n\\r\\nThen here comes a girl called maya. Maya plays a important role in akhil\\&#039;s life and story. We are discussing abt the girl maya in 3rd year. But actually this character is present from 1st year itself. As akhil wont care girls, thats the reason this character didnt came into the story. So its time to know about maya. \\r\\n\\r\\nAs we know akhils present situation is very bad, living in depression due to his lover ananya. At that time here comes a girl maya as a main character in akhils story.\\r\\n\\r\\nWho is maya ?\\r\\n\\r\\nAkhils bestie is maya. Sorry actually more than bestie she is akhils girl friend. A fully commited friend where akhil felt she will be with him life long. Akhil is somewhat selfish, conjuse where he only thinks abt his happiness. But after arrival of maya into akhils life akhil started to change his way of thinking &amp; knowing what actually a maturity his. Akhil never think about others, but started thinking about his friends. Its all because of his way of thinking which was changed by maya. In single word maya became akhils best partner in btech life. So days are going on very good and akhil successfully completed his 3rd year and entered into 4th year in SRM UNIVERSITY.\\r\\n\\r\\nIn akhils story here comes the climax. The things which akhil expected are going in wrong directions till 4-1. Finally his career and his bestie made him alone and left him alone. As we know akhil is more creative so akhil never bother about career, he is confident about his career. The only thing which made akhil unhappy is his bestie and her promises, finally maya made him alone. To come out of ananya\\&#039;s situation maya helped Akhil but this time maya itself made him alone thats the reason akhil is taking lot of time to recover. Akhil never take anyone serious in his life but once if he take anyone serious he never leave &amp; forget them. Thats the reason akhil is suffering a lot alonely, crying lonely and degrading himself. Finally, akhil is trying to motivate himself. Though he can motivate himself but the things which happened in his life never make him happy.\\r\\n\\r\\nSo, Finally there is no one in akhils life except an experience which they thought him.\\r\\n-&gt; Ananya thought akhil what actually a love his.\\r\\n-&gt; Maya thought akhil what actually a life his.\\r\\n( But akhil will never believe anyone else after this experience. )\\r\\n\\r\\nFinally akhil completed his btech life. Working in some product based company. Leading his life and career in right way but he was not happy because he got very strong hurt by his bestie maya. As story mentioned a name kavya, she also plays a major role in akhils btech life. As its a secret crush let the story be also in secret. \\r\\n\\r\\nLater Akhil got married with a beautiful girl. To make the climax of the story somewhat exciting his wife is none other than his secret crush #kavya.\\r\\n\\r\\nIn akhils life the most important people are :\\r\\n\\r\\n1. Ananya a true failure lover. - hurts 50%\\r\\n2. Maya a true failure bestie. - hurts 100%\\r\\n3. Kavya a true secret crush.\\r\\n4. Swaroop a true family best friend.\\r\\n\\r\\n( Note : Akhil is serious abt his bestie becz, akhil never shared anything with ananya, kavya or with anyone. He shared his feelings. He chats a lot. He talks a lot. He rome only with his bestie so thats the reason its very hard to forgive his bestie maya. He completey had a faith on his bestie that she will be along with him life long. But she doesn\\&#039;t. )\\r\\n\\r\\nThanking you\\r\\n', 'private', '', '2018-01-21'),
